import React from 'react';
import './crane.css'

export class Crane extends React.Component {
  state = {
    craneFindMonster: false,
    cranePickup: false,
    craneRaise: false,
    craneMoveRight: false,
    craneDrop: false
  }

  render() {
    return (
      <div className="crane-container">
  	    <div id="crane">
  	      <div id="crane-top" />
  	      <div className="crane-line" />
  	      <div id="crane-claw" />
  	    </div>
  	  </div>
    ) 
  }
}
